import React from 'react';
import './Home.css'; // Import the CSS file for styling
import 'bootstrap/dist/css/bootstrap.css';

export const Home = () => {
  return (
    <div className="home">
      <div className="container-fliud">
        <div className="row">
          <div className="col-sm-6 col-md-2 left-pane">
            <h2>Left Pane</h2>
            {/* Content for the left pane goes here */}
          </div>
          <div className="col-sm-12 col-md-5 middle-pane">
            <h2>Middle Pane</h2>
            {/* Content for the middle pane goes here */}
          </div>
          <div className="col-sm-6 col-md-3 right-pane">
            <h2>Right Pane</h2>
            {/* Content for the right pane goes here */}
          </div>
        </div>
      </div>
    </div>
  );
};
